uvad kõik pistikprogrammid passiivseteks ja teie sait lülitub vaiketeemale ainult teie jaoks. Kõik teised kasutajad näevad teie saiti nagu tavaliselt.','A Troubleshooting Mode menu is added to your admin bar, which will allow you to enable plugins individually, switch back to your current theme, and disable Troubleshooting Mode.'=>'Teie administraatoriribale lisatakse menüü Tõrkeotsingu režiim, mis võimaldab teil pluginad eraldi lubada, lülituda tagasi praegusele teemale ja keelata tõrkeotsingurežiimi.','Please note, that due to how Must Use plugins work, any such plugin will not be disabled for the troubleshooting session.'=>'Pange tähele, et tulenevalt sellest, kuidas pluginad peavad kasutama, ei keelata selliseid pistikprogramme tõrkeotsingu seansi ajal.','Show me how'=>'Näita mulle, kuidas','Loading your support details'=>'Teie tugiteenuste andmete laadimine','These details can help our support team troubleshoot any issues you might be having.'=>'Need üksikasjad võivad aidata meie tugitiimil tõrkeotsingul teie probleemide korral.','PHP version'=>'PHP versioon','WordPress.org communication'=>'WordPress.org suhtlus','WordPress version'=>'WordPressi versioon','SQL server'=>'SQL-server','JSON extension'=>'JSON-laiend','Utf8mb4 support'=>'Utf8mb4 tugi','SSL support'=>'SSL tugi','Operating system'=>'Operatsioonisüsteem','Screen resolution'=>'Ekraani resolutsioon','Web browser'=>'veebibrauseris','Web browser size'=>'Veebibrauseri suurus','Unknown'=>'Tundmatu','Contact Support Team'=>'Võtke ühendust tugitiimiga','Send Message'=>'Saada sõnum','Message to the support team'=>'Teade tugimeeskonnale','Your email address'=>'sinu emaili aadress','Messages sent to the support team through this form will include the debugging information visible on this page.'=>'Selle vormi kaudu tugitiimile saadetud sõnumid sisaldavad sellel lehel nähtavat silumisteavet.','Include information about settings and appointment types'=>'Lisage teave sätete ja kohtumiste tüüpide kohta','Checking this