est message was sent by the Health Check plugin from %1$s (%2$s) on %3$s at %4$s. Since you’re reading this, it obviously works. Additional message from admin: %5$s'=>'Tere! Selle testteate saatis tervisekontrolli pistikprogramm saidilt %1$s (%2$s) saidil %3$s aadressil %4$s. Kuna te seda loete, töötab see ilmselgelt. Lisasõnum administraatorilt: %5$s','We were unable to check if any new versions are available'=>'Me ei suutnud kontrollida, kas mõni uus versioon on saadaval.','%1$s ( Latest version: %2$s )'=>'%1$s (uusim versioon: %2$s)','%1$s ( Latest version: %2$s ) - We strongly urge you to update, as minor updates are often security related.'=>'%1$s (uusim versioon: %2$s) - soovitame tungivalt värskendada, kuna väikesed värskendused on sageli turvalisusega seotud.','You are running WordPress %1$s.'=>'Teil on WordPress %1$s.','Your site has %d plugin waiting to be updated.'=>'Teie saidil on %d plugin, mis ootab värskendamist.' . "\0" . 'Teie saidil on%d pistikprogrammi, mis ootavad värskendamist.','Your site has %d active plugin, and it is up to date.'=>'Teie saidil on %d aktiivset pistikprogrammi ja need on ajakohased.' . "\0" . 'Teie saidil on%d aktiivset pistikprogrammi ja need on kõik ajakohased.','Your site has %d inactive plugin, it is recommended to remove any unused plugins to enhance your site security.'=>'Teie saidil on %d passiivset pistikprogrammi, saidi turvalisuse parandamiseks on soovitatav eemaldada kõik kasutamata pluginad.' . "\0" . 'Teie saidil on%d passiivset pistikprogrammi, saidi turvalisuse parandamiseks on soovitatav kõik kasutamata pistikprogrammid eemaldada.','Your site has %d theme waiting to be updated.'=>'Teie saidil on %d teema(t), mis ootab värskendamist.' . "\0" . 'Teie saidil on%d teemat, mis ootavad värskendamist.','Your site has %d installed theme, and it is up to date.'=>'Teie saidil on %d installitud teema ja see on ajakohane.' . "\0" . 'Teie saidil on%d installitud teemat ja need on kõik ajakohased.','Your version of PHP, %1$s, is very outdated and no longer receiving security updates. You should contact your host for an upgrade, WordPress recommends using PHP version %2$s.'=>'Teie PHP versioon, %1$s, on väga vananenud ja ei saa enam turvavärskendusi. Uuendamiseks peaksite võtma ühendust oma hostiga, WordPress soovitab kasutada PHP versiooni %2$s.','Your site has %1$d inactive theme. To enhance your sites security it is recommended to remove any unused themes. You should keep %2$s, the default WordPress theme, %3$s, your current theme and %4$s, the parent theme.'=>'Teie saidil on %1$d passiivne teema. Oma saitide turvalisuse suurendamiseks on soovitatav eemaldada kasutamata teemad. Peaksite hoidma %2$s, WordPressi vaikemood, %3$s, teie praegune teema ja %4$s, vanema teema.' . "\0" . 'Teie saidil on%1$d passiivset teemat. Oma saitide turvalisuse suurendamiseks on soovitatav eemaldada kasutamata teemad. Peaksite hoidma%2$s, WordPressi vaikemood,%3$s, teie praegune teema ja%4$s, vanema teema.','Your site has %1$d inactive theme, other than %2$s, the default WordPress theme, and %3$s, your active theme. It is recommended to remove any unused themes to enhance your sites security.'=>'Teie saidil on passiivne teema %1$d, va WordPressi vaikemood ja %3$s, aktiivne teema, va %2$s. Oma saitide turvalisuse parandamiseks on soovitatav eemaldada kasutamata teemad.' . "\0" . 'Teie saidil on%1$d passiivset teemat, va%2$s, vaikimisi WordPressi teema ja%3$s, aktiivne teema. Oma saitide turvalisuse parandamiseks on soovitatav eemaldada kasutamata teemad.','Your version of PHP, %1$s, is very outdated and no longer receiving security updates and is not supported by WordPress. You should contact your host for an upgrade, WordPress recommends using PHP version %2$s, but will work with version %3$s or newer.'=>'Teie PHP versioon, %1$s, on väga aegunud ja ei saa enam turbevärskendusi ning seda ei toeta WordPress. Uuendamiseks peaksite võtma ühendust oma hostiga, WordPress soovitab kasutada PHP versiooni %2$s, kuid see töötab versiooniga %3$s või uuemaga.','For performance and security reasons, we strongly recommend running %1$s version %2$s or higher.'=>'Toimivuse ja turvalisuse huvides soovitame tungivalt käivitada %1$s versioon %2$s või uuem.','WordPress 3.2+ requires %1$s version %2$s or higher.'=>'WordPress 3.2+ nõuab versiooni %1$s %2$s või uuemat.','You are using a <code>wp-content/db.php</code> drop-in which might mean that a %s database is not being used.'=>'Kasutate rippmenüüd <code>wp-content/db.php</code>, mis võib tähendada, et %s andmebaasi ei kasutata.','WordPress\' utf8mb4 support requires MySQL version %s or greater'=>'WordPressi utf8mb4 tugi nõuab MySQL versiooni %s või uuemat','WordPress\' utf8mb4 support requires MariaDB version %s or greater'=>'WordPressi utf8mb4 tugi nõuab MariaDB versiooni %s või uuemat','WordPress\' utf8mb4 support requires MySQL client library (%1$s) version %2$s or newer.'=>'WordPressi utf8mb4 tugi nõuab MySQL-i klienditeegi (%1$s) versiooni %2$s või uuemat.','A scheduled event (%s) has failed to run. Your site still works, but this may indicate that notifications and synchronization with 3rd party services may not work as intended.'=>'Plaanitud sündmuse (%s) käivitamine nurjus. Teie sait töötab endiselt, kuid see võib osutada, et märguanded ja sünkroonimine kolmanda osapoole teenustega ei pruugi õigesti töötada.','No response'=>'Mingit vastust','Support'=>'Toetus','You don\'t have any of the default themes installed. A default theme helps you determine if your current theme is causing conflicts.'=>'Teil pole ühtegi vaiketeemat installitud. Vaiketeema aitab teil kindlaks teha, kas teie praegune teema põhjustab konflikte.','Install a default theme'=>'Installige vaiketeema','Disable while troubleshooting'=>'Keelake tõrkeotsingu ajal','Enable while troubleshooting'=>'Luba tõrkeotsingu ajal','Troubleshooting Mode'=>'Veaotsingu režiim','Manage active plugins'=>'Halda aktiivseid pistikprogramme','Plugins'=>'Pluginad','Themes'=>'Teemad',