d','Active editor'=>'Aktiivne toimetaja','Imagick Module Version'=>'Imagicki mooduliversioon','ImageMagick Version'=>'ImageMagicki versioon','Imagick Resource Limits'=>'Kujutiste ressursi piirid','GD Version'=>'GD versioon','GD not available'=>'GD pole saadaval','Not available'=>'Pole saadaval','Unable to determine if Ghostscript is installed'=>'Ei saa kindlaks teha, kas Ghostscript on installitud','Ghostscript Version'=>'Ghostscripti versioon','Server architecture'=>'Serveri arhitektuur','Unable to determine server architecture'=>'Serveri arhitektuuri pole võimalik kindlaks teha','PHP Version'=>'PHP versioon','Unable to determine PHP version'=>'PHP versiooni ei saa kindlaks teha','(Supports 64bit values)'=>'(Toetab 64-bitiseid väärtusi)','PHP SAPI'=>'PHP SAPI','Unable to determine PHP SAPI'=>'PHP SAPI-d ei õnnestu tuvastada','Server settings'=>'Serveri sätted','Unable to determine some settings as the ini_get() function has been disabled'=>'Mõningaid sätteid ei õnnestu tuvastada, kuna funktsioon ini_get () on keelatud','PHP max input variables'=>'PHP max sisendmuutujad','PHP time limit'=>'PHP ajaline piirang','PHP memory limit'=>'PHP mälupiirang','Max input time'=>'Maksimaalne sisestusaeg','Upload max filesize'=>'Laadige üles maksimaalne failisuurus','PHP post max size'=>'PHP postituse maksimaalne suurus','cURL Version'=>'cURL-i versioon','Your server does not support cURL'=>'Teie server ei toeta cURL-i','SUHOSIN installed'=>'SUHOSIN on installitud','Is the Imagick library available'=>'Kas Imagicki raamatukogu on saadaval','htaccess rules'=>'htaccess reeglid','Custom rules have been added to your htaccess file'=>'Teie htaccess-faili on lisatud kohandatud reeglid','Your htaccess file only contains core WordPress features'=>'Teie htaccess-fail sisaldab ainult WordPressi põhifunktsioone','Extension'=>'Pikendus','Server version'=>'Serveri versioon','Client version'=>'Kliendi versioon','Database user'=>'Andmebaasi kasutaja','Database host'=>'Andmebaasi host','Database name'=>'Andmebaasi nimi','Database prefix'=>'Andmebaasi eesliide','No version or author information available'=>'Versioon või teave autori kohta pole saadaval','Author website'=>'Autori veebisait','Parent theme'=>'Vanemateema','Not a child theme'=>'Pole lapse teema','Supported theme features'=>'Toetatud teemafunktsioonid','The Must Use Plugins directory'=>'Pluginate kataloog peab olema kohustuslik','Uploads Directory'=>'Laeb kataloog üles','Themes Directory'=>'Teemade kataloog','Plugins Directory'=>'Pistikprogrammide kataloog','Database size'=>'Andmebaasi suurus','Whole WordPress Directory'=>'Terve WordPressi kataloog','Total installation size'=>'Installimise kogumaht','- Some errors, likely caused by invalid permissions, were encountered when determining the size of your installation. This means the values represented may be inaccurate.'=>'- Installimise suuruse määramisel ilmnesid mõned vead, mis võivad olla tingitud kehtetutest lubadest. See tähendab, et esindatud väärtused võivad olla ebatäpsed.','Content changed'=>'Sisu muudetud','(View Diff)'=>'(Kuva erinevus)','File not found'=>'Faili ei leitud','All files passed the check. Everything seems to be ok!'=>'Kõik failid läbisid kontrolli. Tundub, et kõik on ok!','It appears as if some files may have been modified.'=>'Näib, nagu oleks mõnda faili muudetud.','One possible reason for this may be that your installation contains translated versions. An easy way to clear this is to reinstall WordPress. Don\'t worry. This will only affect WordPress\' own files, not your themes, plugins or uploaded media.'=>'Selle üks võimalik põhjus võib olla see, et teie install sisaldab tõlgitud versioone. Lihtne viis selle kustutamiseks on WordPressi uuesti installimine. Ärge muretsege. See mõjutab ainult WordPressi enda faile, mitte teie teemasid, pistikprogramme ega üleslaaditud meediume.','Status'=>'Olek','File'=>'Toimik','Reason'=>'Põhjus','The File Integrity checks all the core files with the <code>checksums</code> provided by the WordPress API to see if they are intact. If there are changes you will be able to make a Diff between the files hosted on WordPress.org and your installation to see what has been changed.'=>'Faili terviklikkus kontrollib WordPress API pakutavate <code> kontrollsummade </code> abil kõiki põhifaile, et näha, kas need on puutumatud. Kui seal on muudatusi, saate WordPress.org-is hostitud failide ja installimise vahel vahet teha, et näha, mida on muudetud.','Check the Files Integrity'=>'Kontrollige faili terviklikkust','File Integrity'=>'Faili terviklikkus','The loopback request to your site failed, this may prevent WP_Cron from working, along with theme and plugin editors.'=>'Teie saidi tagasihelistamistaotlus nurjus, see võib takistada WP_Cronil koos teema- ja pistikprogrammide toimetajatega töötamast.','The loopback request to your site completed successfully.'=>'Teie saidi tagasihelistamisnõue on edukalt täidetud.','Result from testing without any plugins active and a default theme'=>'Testimise tulemus ilma, et pistikprogrammid oleksid aktiivsed ja vaiketeema','Waiting...'=>'Ootan ...','We have just sent an e-mail using <code>wp_mail()</code> and it seems to work. Please check your inbox and spam folder to see if you received it.'=>'Äsja saatsime meilisõnumi aadressil <code> wp_mail () </code> ja see tundub töötavat. Kontrollige oma postkasti ja rämpsposti kausta, et näha, kas olete selle kätte saanud.','It seems there was a problem sending the e-mail.'=>'Näib, et e-kirja saatmisel oli probleem.','The Mail Check will invoke the <code>wp_mail()</code> function and check if it succeeds. We will use the E-mail address you have set up, but you can change it below if you like.'=>'Postikontroll kutsub esile funktsiooni <code> wp_mail () </code> ja kontrollib, kas see õnnestub. Kasutame teie loodud e-posti aadressi, kuid soovi korral saate seda allpool muuta.','Additional message'=>'Lisateade','Send test mail'=>'Saada testpost','Mail Check'=>'Posti kontroll','Your site does not have a default theme, default themes are used by WordPress automatically if anything is wrong with your normal theme.'=>'Teie saidil pole vaiketeemat, WordPress kasutab vaikimisteemasid automaatselt, kui teie tavalise teemaga on midagi valesti.','The PHP install on your server has the JSON extension disabled and is therefore not compatible with WordPress 3.2 or newer.'=>'Teie serveri PHP installimisel on JSON-laiend keelatud ja seetõttu ei ühildu see WordPress 3.2-ga või uuemaga.','Your PHP install supports JSON.'=>'Teie PHP install toetab JSON-i.','Your MySQL version supports utf8mb4'=>'Teie MySQL-i versioon toetab utf8mb4','Your MariaDB version supports utf8mb4'=>'Teie MariaDB versioon toetab utf8mb4','WordPress.org is reachable from your server.'=>'WordPress.org on teie serverist juurdepääsetav.','You are accessing this website using HTTPS, but your <a href="%s">WordPress Address</a> is not set up to use HTTPS by default.'=>'Pääsete sellele veebisaidile HTTPS-i abil, kuid teie <a href="%s">WordPressi aadress</a> pole vaikimisi seadistatud HTTPS-i kasutama.','You are accessing this website using HTTPS.'=>'Sellele veebisaidile pääsete HTTPS-i kaudu.','You are not using HTTPS to access this website.'=>'Te ei kasuta sellel veebisaidil juurdepääsuks HTTPS-i.','Your WordPress install can communicate securely with other services.'=>'Teie WordPressi install saab turvaliselt suhelda teiste teenustega.','Your WordPress install cannot communicate securely with other services. Talk to your web host about OpenSSL support for PHP.'=>'Teie WordPressi install ei saa teiste teenustega turvaliselt suhelda. Rääkige oma veebiga OpenSSL-i PHP-toe kohta.','No scheduled events have been missed.'=>'Ühtegi plaanitud sündmust pole mööda lastud.','We were unable to create the mu-plugins directory.'=>'Me ei saanud luua mu-pluginate kataloogi.','We could not remove the old must-use plugin.'=>'Me ei saanud vana kohustuslikku pistikprogrammi eemaldada.','We were unable to copy the plugin file required to enable the Troubleshooting Mode.'=>'Me ei saanud tõrkeotsingu režiimi lubamiseks vajalikku pistikfaili kopeerida.','We were unable to replace the plugin file required to enable the Troubleshooting Mode.'=>'Me ei suutnud asendada tõrkeotsingu režiimi lubamiseks vajalikku pistikfaili.','You have successfully enabled Troubleshooting Mode, all plugins will appear inactive until you disable Troubleshooting Mode, or log out and back in again.'=>'Veaotsingu režiim on edukalt sisse lülitatud, kõik pistikprogrammid kuvatakse passiivsetena, kuni olete tõrkeotsingu režiimi välja lülitanud või väljalogitud ja uuesti sisse logitud.','Return to the Dashboard'=>'Naaske armatuurlauale','Enable Troubleshooting Mode'=>'Luba tõrkeotsingu režiim','No scheduled events exist on this site.'=>'Sellel saidil pole ühtegi plaanitud sündmust.','Copied'=>'Kopeeritud','Currently being tested...'=>'Praegu testitakse ...','Troubleshoot'=>'Tõrkeotsing','Site Status'=>'Saidi olek','Debug Information'=>'Silumisinfo','Troubleshooting'=>'Veaotsing','PHP Information'=>'PHP teave','Tools'=>'Tööriistad','Remember to keep backups'=>'Ärge unustage varundada','Because of how Troubleshooting Mode functions, unforeseen conflicts with other plugins or themes may in rare cases occur, leading to unexpected behaviors.'=>'Tõrkeotsingurežiimi toimimise tõttu võivad harvadel juhtudel tekkida ettenägematud konfliktid teiste pistikprogrammide või teemadega, mis võib põhjustada ootamatuid käitumisharjumusi.','We therefore strongly recommend <a href="https://codex.wordpress.org/WordPress_Backups">making a backup of your site</a> before you enable troubleshooting mode.'=>'Seetõttu soovitame tungivalt enne tõrkeotsingu režiimi <a href="https://codex.wordpress.org/WordPress_Backups">lubamist varundada oma sait</a> .','I understand'=>'Ma saan aru','The system information shown below can also be copied and pasted into support requests such as on the WordPress.org forums, or to your theme and plugin developers.'=>'Allpool näidatud süsteemiteavet saab ka kopeerida ja kleepida tugitaotlustesse, näiteks WordPress.orgi foorumitesse, või teema- ja pistikprogrammide arendajatele.','Additionally, since we really want to make this plugin as safe as possible, if you should have any problems with the troubleshooting mode, please create a new topic in the <a href="https://wordpress.org/support/plugin/health-check">plugins support forum</a> with details about what theme and what plugins you’re using and the steps needed to reproduce the problem. This will help us to analyze and fix such problems.'=>'Lisaks, kuna soovime selle pistikprogrammi tõesti võimalikult turvaliseks muuta, kui teil peaks tõrkeotsingu režiimi korral probleeme olema, looge <a href="https://wordpress.org/support/plugin/health-check">pistikprogrammide tugifoorumis</a> uus teema, kus on üksikasjad selle kohta, millist teemat ja milliseid pistikprogramme te kasutate ja probleemi taastootmiseks vajalikud sammud. See aitab meil selliseid probleeme analüüsida ja lahendada.','Show copy and paste field'=>'Kuva kopeerimise ja kleepimise väli','Show copy and paste field in English'=>'Kuva kopeerimise ja kleepimise väli inglise keeles','Some information may be filtered out from the list you are about to copy, this is information that may be considered private, and is not meant to be shared in a public forum.'=>'Osa teavet võidakse kopeeritavast loendist välja filtreerida, see on teave, mida võidakse pidada privaatseks ja mis pole mõeldud avalikus foorumis jagamiseks.','Mark field for copying'=>'Märkige väli kopeerimiseks','Table Of Contents'=>'Sisukord','Return to table of contents'=>'Naase sisukorra juurde','The phpinfo() function has been disabled by your host. Please contact the host if you need more information about your setup.'=>'Teie host on funktsiooni phpinfo () keelanud. Kui vajate seadistamise kohta lisateavet, võtke ühendust hostiga.','The link to the Update PHP page, which may be localized.https://wordpress.o